import{f as e,D as n,c as I,o as r,k as i,a4 as t,H as a,a as o}from"./chunks/framework.BAs4fWuZ.js";const h=JSON.parse('{"title":"2015-2025：十年技术路（面试速记版）","description":"","frontmatter":{"title":"2015-2025：十年技术路（面试速记版）"},"headers":[],"relativePath":"ten-years/2025-aigc-interview-notes.md","filePath":"ten-years/2025-aigc-interview-notes.md","lastUpdated":1769622217000}'),s={name:"ten-years/2025-aigc-interview-notes.md"};function C(b,l,u,d,c,A){const g=n("InkMermaidBlock");return r(),I("div",null,[l[0]||(l[0]=i("div",{class:"alert read-stats",role:"note"},[i("span",{class:"read-stats__icon","aria-hidden":"true"},"🔖"),i("span",{class:"read-stats__text"},[o("本文约 "),i("b",null,"1817"),o(" 字，阅读预计耗时 "),i("b",null,"5"),o(" 分钟。")])],-1)),l[1]||(l[1]=i("div",{class:"alert ai-disclosure",role:"note"},[i("span",{class:"ai-disclosure__icon","aria-hidden":"true"},"ⓘ"),i("span",{class:"ai-disclosure__text"},"AI 辅助写作声明：本文由博主构思逻辑，AI 辅助润色，双方共同校对。")],-1)),l[2]||(l[2]=t('<p>这份文档是给面试用的“速记版”，梳理了从金山（Web 技术深耕）、头条/飞书（管理与自研引擎）到字节电商（AIGC 业务落地）的技术路径。重点在于解释我在不同阶段解决过什么瓶颈问题，以及如何从前端工程师视角切入 AIGC 领域。</p><h2 id="_1-金山时期-web-技术深度与瓶颈突破-技术亮点备忘" tabindex="-1">1. 金山时期：Web 技术深度与瓶颈突破（技术亮点备忘） <a class="header-anchor" href="#_1-金山时期-web-技术深度与瓶颈突破-技术亮点备忘" aria-label="Permalink to &quot;1. 金山时期：Web 技术深度与瓶颈突破（技术亮点备忘）&quot;">​</a></h2><p>这一阶段的核心关键词是：<strong>标准深挖、浏览器 Hack、工程极致优化</strong>。</p><h3 id="_1-1-深入标准与底层实现" tabindex="-1">1.1 深入标准与底层实现 <a class="header-anchor" href="#_1-1-深入标准与底层实现" aria-label="Permalink to &quot;1.1 深入标准与底层实现&quot;">​</a></h3><p>在处理 Web 端与 Office 标准（OOXML）互操作时，遇到的问题往往触及浏览器或标准的底层瓶颈。</p><h4 id="_1-跨端一致性-png-数据深度解析" tabindex="-1">1) 跨端一致性：PNG 数据深度解析 <a class="header-anchor" href="#_1-跨端一致性-png-数据深度解析" aria-label="Permalink to &quot;1) 跨端一致性：PNG 数据深度解析&quot;">​</a></h4><ul><li><strong>背景</strong>：Web 端图片与 OOXML 对图片数据的理解存在底层差异（例如 DPI/物理尺寸信息的处理），导致同一张图在 Web 和 Office 中渲染大小不一致。</li><li><strong>解法</strong>：不依赖 Canvas 或 Image 标签的浅层 API，而是直接通过 <code>BinaryReader</code> 解析 PNG 二进制流，深入到 Chunk 级别提取 <code>pHYs</code>（物理像素尺寸）信息，手动计算并抹平渲染差异。</li><li><strong>价值</strong>：解决了跨端渲染一致性问题，建立了对二进制数据处理的工程自信。</li><li><strong>博客</strong>：<a href="https://ede.ink/learn_png_data.html" target="_blank" rel="noreferrer">https://ede.ink/learn_png_data.html</a></li></ul><h4 id="_2-性能瓶颈-虚拟滚动与-第二线程" tabindex="-1">2) 性能瓶颈：虚拟滚动与“第二线程” <a class="header-anchor" href="#_2-性能瓶颈-虚拟滚动与-第二线程" aria-label="Permalink to &quot;2) 性能瓶颈：虚拟滚动与“第二线程”&quot;">​</a></h4><ul><li><strong>背景</strong>：在复杂文档（大纲/长文）场景下，DOM 节点数量轻易突破浏览器限制，导致主线程卡顿。</li><li><strong>解法</strong>： <ul><li><strong>Mock Scroll Bar</strong>：接管原生滚动行为，实现精确的惯性与回弹。</li><li><strong>Slicing &amp; Scheduling</strong>：将繁重的布局任务切片，配合 CSS Transform 将绘制任务卸载到 Compositor Thread（开启“第二线程”效果）。</li><li><strong>开源贡献</strong>：在极限调优过程中发现了 Chromium 的 Bug，提交 Patch 并成为 Contributor (<a href="https://issues.chromium.org/issues/41475251" target="_blank" rel="noreferrer">Issue 41475251</a>)。</li></ul></li><li><strong>架构图（常规编辑器 vs 虚拟化方案）</strong>：</li></ul>',9)),a(g,{codeBase64:""}),l[3]||(l[3]=i("h3",{id:"_1-2-架构演进-从-rich-text-到-block-editor-类-notion",tabindex:"-1"},[o("1.2 架构演进：从 Rich Text 到 Block Editor（类 Notion） "),i("a",{class:"header-anchor",href:"#_1-2-架构演进-从-rich-text-到-block-editor-类-notion","aria-label":'Permalink to "1.2 架构演进：从 Rich Text 到 Block Editor（类 Notion）"'},"​")],-1)),l[4]||(l[4]=i("p",null,"在金山后期，我参与了类 Notion 项目（Block-based Editor）的架构升级。这是从“文档流”到“数据块”的范式转变。",-1)),a(g,{codeBase64:""}),l[5]||(l[5]=t('<ul><li><strong>核心差异</strong>： <ul><li><strong>常规编辑器</strong>：线性的 HTML/DOM 结构，操作的是 Range 和 Text Node。</li><li><strong>Block Editor</strong>：树状的 JSON 数据结构，操作的是 Block ID 和 Properties，渲染层只是数据的投影。这也是后来做 AIGC 结构化生成的重要基础。</li></ul></li></ul><h3 id="_1-3-意想不到的业务收益-webpack-tree-shaking-优化" tabindex="-1">1.3 意想不到的业务收益：Webpack Tree Shaking 优化 <a class="header-anchor" href="#_1-3-意想不到的业务收益-webpack-tree-shaking-优化" aria-label="Permalink to &quot;1.3 意想不到的业务收益：Webpack Tree Shaking 优化&quot;">​</a></h3><p>很多时候，最大的业务收益不是来自复杂的架构设计，而是来自“闲来无事看一眼产物”的好奇心。</p><ul><li><strong>背景</strong>：核心逻辑从 C++ 翻译到 JavaScript，导致大量历史遗留代码。</li><li><strong>发现</strong>：闲暇时检查 Webpack 打包产物，发现 <code>common.js</code> 体积异常，且 Tree Shaking 失效。</li><li><strong>根因</strong>： <ul><li><code>export enum</code> 被转译为 IIFE（立即执行函数），Webpack 判定为有副作用（Side Effect）。</li><li>C++ 风格的枚举 Key 极长（如 <code>LONG_LONG_NAMESPACE</code>），严重占用体积。</li></ul></li><li><strong>解决</strong>：手动修改导出方式，标记 Side Effect Free，介入 Tree Shaking 过程。</li><li><strong>结果</strong>：<strong>包体积直接减少 6%</strong>。</li><li><strong>感悟</strong>：互联网技术迭代太快，很多时候没有现成的“经验”可复用，靠的是灵光一闪和“心有猛虎，细嗅蔷薇”的细腻。回归程序员本质：<strong>发现问题 -&gt; 解决问题</strong>。</li></ul><hr><h2 id="_2-头条时期-管理初探与教育复盘" tabindex="-1">2. 头条时期：管理初探与教育复盘 <a class="header-anchor" href="#_2-头条时期-管理初探与教育复盘" aria-label="Permalink to &quot;2. 头条时期：管理初探与教育复盘&quot;">​</a></h2><p>这一段经历主要集中在与学生/实习生的交流与管理上。</p><ul><li><strong>实践</strong>：将一个班级分成四个小组，每组设立一位组长，分别负责一个技术方向。</li><li><strong>反思（关于大纲与复用）</strong>： <ul><li><strong>美中不足</strong>：当时工作很“傻乎乎”，最大的问题是<strong>缺少大纲</strong>。</li><li><strong>教训</strong>：没有意识到像 Bilibili 网课那样“一次录制，无限复用”的威力。当时的做法是一个文件、一个知识点重复讲很多遍，效率极低。</li><li><strong>感悟</strong>：做事应该<strong>先有大纲（Schema/Syllabus）</strong>，再按图索骥。这也直接影响了我现在的写作和工作习惯（例如本次面试准备也是先列大纲）。</li></ul></li></ul><hr><h2 id="_3-飞书时期-自研渲染引擎的探索" tabindex="-1">3. 飞书时期：自研渲染引擎的探索 <a class="header-anchor" href="#_3-飞书时期-自研渲染引擎的探索" aria-label="Permalink to &quot;3. 飞书时期：自研渲染引擎的探索&quot;">​</a></h2><p>这一阶段主要参与了 <strong>Faster</strong> 框架（字节内部的 Flutter-like 渲染框架）的建设。</p><ul><li><strong>背景</strong>：试图摆脱 Web 渲染管线的限制，自研一套跨端渲染引擎。</li><li><strong>结果</strong>：虽然因缺乏移动端深度协作等原因，Faster 未能大规模推广。</li><li><strong>技术亮点</strong>：<strong>InkWell（水波纹效果）</strong>。 <ul><li>这是一个非常能打动人的细节。在自绘引擎中，如何优雅地处理点击反馈、动画扩散以及手势裁切，InkWell 的实现代表了对交互细节的极致追求。</li></ul></li></ul><hr><h2 id="_4-字节电商时期-aigc-业务落地与架构演进" tabindex="-1">4. 字节电商时期：AIGC 业务落地与架构演进 <a class="header-anchor" href="#_4-字节电商时期-aigc-业务落地与架构演进" aria-label="Permalink to &quot;4. 字节电商时期：AIGC 业务落地与架构演进&quot;">​</a></h2><p>这一阶段的核心关键词是：<strong>跨界学习、打破边界、三层架构落地</strong>。</p><h3 id="_4-1-早期探索-模板化生成链路-图文时代" tabindex="-1">4.1 早期探索：模板化生成链路（图文时代） <a class="header-anchor" href="#_4-1-早期探索-模板化生成链路-图文时代" aria-label="Permalink to &quot;4.1 早期探索：模板化生成链路（图文时代）&quot;">​</a></h3><p>在指令编辑（Nano）尚未普及之前，主流还是基于 StableDiffusion。当时我的思路是在“纯底图”逻辑上做文章。</p><ul><li><strong>思考</strong>：Nano 的指令编辑（如“识别物体 -&gt; Mask 擦除 -&gt; Inpaint”）虽然灵活，但当时技术尚不成熟。</li><li><strong>实践</strong>：我构建了一套基于**模板（Template）**的生成链路。本质上是在不确定的 AI 生成内容上，引入确定性的 Schema 约束。</li></ul>',18)),a(g,{codeBase64:""}),l[6]||(l[6]=t('<ul><li><strong>评价</strong>：这一套流程虽然稳定，但略显繁琐，确实不如后来的“虚拟试衣”那样具有指令编辑的颠覆性。</li></ul><h3 id="_4-2-a2ui-从-gui-到-lui-的架构演进" tabindex="-1">4.2 A2UI：从 GUI 到 LUI 的架构演进 <a class="header-anchor" href="#_4-2-a2ui-从-gui-到-lui-的架构演进" aria-label="Permalink to &quot;4.2 A2UI：从 GUI 到 LUI 的架构演进&quot;">​</a></h3><p>这是一个面向 B 端的尝试，核心是将 UI 抽象为 <strong>“数据（展示什么） + 动作（点击后做什么）”</strong>。</p><ul><li><strong>核心概念</strong>： <ul><li><strong>新协议</strong>：Markdown / Natural Language。以前是基于 API 协议调用，现在是基于 Workflow + Prompt。</li><li><strong>黑盒与智能</strong>：在一个严谨的编码系统中，引入“黑盒”（模型），虽然引入了不确定性，但也引入了智能。</li><li><strong>MultiAgent</strong>：大模型（高智商）负责编排，小模型（快速度）负责执行，多数公司做微调。</li></ul></li></ul>',4)),a(g,{codeBase64:""}),l[7]||(l[7]=t('<h3 id="_4-3-核心理念-前端工程师的-aigc-突围" tabindex="-1">4.3 核心理念：前端工程师的 AIGC 突围 <a class="header-anchor" href="#_4-3-核心理念-前端工程师的-aigc-突围" aria-label="Permalink to &quot;4.3 核心理念：前端工程师的 AIGC 突围&quot;">​</a></h3><ol><li><strong>结合自身优势</strong>：利用前端在“结构化数据处理”和“可视化工作流”上的优势，设计了<strong>模板生成链路</strong>。通过精准控制 SD 的 ControlNet 和 Prompt，实现了高质量的商图生成，拿到了当年的 M+ 绩效。</li><li><strong>打破边界</strong>：谁说前端不能搞 AIGC？从了解模型原理，到部署推理服务，再到设计业务工作流，我打通了从算法到产品的最后一公里。</li></ol><h3 id="_4-4-电商-aigc-业务架构-三层模型" tabindex="-1">4.4 电商 AIGC 业务架构（三层模型） <a class="header-anchor" href="#_4-4-电商-aigc-业务架构-三层模型" aria-label="Permalink to &quot;4.4 电商 AIGC 业务架构（三层模型）&quot;">​</a></h3><p>这是我在电商 AIGC 落地过程中沉淀的通用架构图，遵循严格的**自下而上（Bottom-Up）**支撑关系：</p>',4)),a(g,{codeBase64:""}),l[8]||(l[8]=i("ul",null,[i("li",null,[i("strong",null,"算法与基建层 (Algorithm)"),o("：提供最原子化的 AI 能力（文生图、图生图、大语言模型）。")]),i("li",null,[i("strong",null,"工程平台层 (Engineering)"),o("：我主要工作的核心区域。把不稳定的算法能力，封装成稳定的、可观测的、可编排的工程服务（Workflow），并管理素材资产。")]),i("li",null,[i("strong",null,"业务应用层 (Business)"),o("：直接面向运营和商家的具体场景，如虚拟试衣、营销图生成等。")])],-1))])}const W=e(s,[["render",C]]);export{h as __pageData,W as default};
